import {Fragment} from 'react';
import classes from './Login.module.css';
const Login=()=>{
    return(
        <Fragment>
            <form >
                <div>
                    <label>Email</label>
                    <input type='email'/>
                    <br/>
                    &nbsp;
                    </div>
                    <div>
                    <label>Password</label>
                    <input type='number' /><br/>
                    &nbsp;
                    </div>
                    <button type='submit'>Login</button>
            </form> 
        </Fragment>
    )
}
export default Login;
